import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
        <div> <main /> </div>
        <div className="App">
            <ul>
                <li>CSS</li>
                <li>Js</li>
                <li>HTML</li>
            </ul>
        </div>
    </div>
  );
}

const main = () => {
    return (
        <div className="header">
            <span>Span Element</span>
        </div>
    );
}

export default App;
